import { Component, OnInit } from '@angular/core';
import { ReportsService } from '../../../services/reports.service';
import { Subject, takeUntil } from 'rxjs';

@Component({
  selector: 'app-reports',
  templateUrl: './reports.component.html',
  styleUrls: ['./reports.component.scss']
})
export class ReportsComponent implements OnInit {

  options: any = {}
  data: any = [
    {
      "empName": "Tom Disney",
      "empId": "Bob_596",
      "date": "09-07-2024 20:50:41",
      "live_confidence": 75.47016906738281,
      "recog_confidence": "NA",
      "image": "data:image/jpeg;base64,"
    },
    {
      "empName": "Sam Sample",
      "empId": "Bob_595",
      "date": "09-07-2024 20:54:16",
      "live_confidence": 75.7498779296875,
      "recog_confidence": "NA",
      "image": "data:image/jpeg;base64,"
    }
  ]

  tableData: any;
  destroy$: Subject<void> = new Subject<void>;

  constructor(
    private reportsService: ReportsService,
  ) { }

  ngOnInit(): void {
    this.options = {
      tableId: 'businessReportsTable',
      tableHeaderScrollContainerOffset: 0,
      stickyFooter: true,
      stickyHeader: true,
      locale: 'en',
      endpoints: {
        data: {
          url: "business/getassignmentreports",
          method: 'GET',
        },
      },
      deferLoading: true,
      newFiltersComponent: false,
      columnHeaders: [
        "Name", "Email", "Phone"
      ],
      filterData: [
        ["sid", "sid@gmail.com", "224343 "]
      ],
      allowSavedViews: false,
      allowSearch: true,
      searchPlaceholder : 'Search',
      allowGroupByData: true,
      defaultDensity: "expanded"
    };

    this.reportsService.getTableData().pipe(
      takeUntil(this.destroy$)
    ).subscribe((data: any) => {
      for (const d of data) {
        d.image = 'data:image/jpeg;base64,' + d.image;
      }
      this.tableData = data;
      console.log("data in reports: ", data);
    })


    
    
  }

  ngOnDestroy(): void {
    //Called once, before the instance is destroyed.
    //Add 'implements OnDestroy' to the class.
    this.destroy$.next();
  }

}


